import Paper from '@material-ui/core/Paper'
import Footer from './Footer'

const Layout = ({ children }) => {
  return (
    <>
      <Paper style={{ height: '100%', width: '100%' }}>
      <Navbar />
      {children}
      </Paper>

    </>
  )
}

export default Layout
